import { useEffect, useState } from "react";
import moment from "moment-timezone";

function App() {
  const [time, setTime] = useState(true);

  useEffect(() => {
    setInterval(() => setTime(!time), 1000);
  }, [time]);

  return <h1>{moment().format("LTS")}</h1>;
}

export default App;
